import React, { memo } from "react";
import {StyleSheet,ScrollView} from "react-native";
import { Navigation } from "../navigation/types";
import Background from "../components/Background";
import Button from "../components/Button";
import AppBar from "../components/AppBar";
import { withTheme } from 'react-native-paper';
import {Linechart, Barchart,Piechart,Progresschart,StackedBarchart }from "../components/LineChart";
type Props = {
  navigation: Navigation;
  previous: any;
  theme:any 
};

const Dashboard = ({ navigation, previous, }: Props) => (
  <ScrollView >
    <AppBar navigation={navigation} previous={previous} title="Dashboard" />
    <Background>
      <Button onPress={() => navigation.navigate("Todo")} >To Do List</Button>
      <Linechart />
      <Barchart />
      <Piechart />
      <Progresschart />
      <StackedBarchart/>
    </Background>
    </ScrollView>
);
const styles = StyleSheet.create({

  Charts: {
    backgroundColor: 'pink',
    marginHorizontal: 20,
  },

});
export default memo(Dashboard);
